    /**
     * Return the short name for the linebreak property corresponding
     * to the given symbolic constant.
     *
     * @param i the numeric value of the linebreak property
     * @return the short name of the linebreak property
     */
    public static String getLineBreakPropertyShortName(byte i) {
        if (i > 0 && i <= lineBreakPropertyShortNames.length) {
            return lineBreakPropertyShortNames[i - 1];
        } else {
            return null;
        }
    }

    /**
     * Return the long name for the linebreak property corresponding
     * to the given symbolic constant.
     *
     * @param i the numeric value of the linebreak property
     * @return the long name of the linebreak property
     */
    public static String getLineBreakPropertyLongName(byte i) {
        if (i > 0 && i <= lineBreakPropertyLongNames.length) {
            return lineBreakPropertyLongNames[i - 1];
        } else {
            return null;
        }
    }

    /**
     * Return the linebreak property constant for the given <code>char</code>
     *
     * @param c the <code>char</code> whose linebreak property to return
     * @return the constant representing the linebreak property
     */
    public static byte getLineBreakProperty(char c) {
        return lineBreakProperties[c / 128][c % 128];
    }

    /**
     * Return the break class constant for the given pair of linebreak
     * property constants.
     *
     * @param lineBreakPropertyBefore the linebreak property for the first character
     *        in a two-character sequence
     * @param lineBreakPropertyAfter the linebreak property for the second character
     *        in a two-character sequence
     * @return the constant representing the break class
     */
    public static byte getLineBreakPairProperty(int lineBreakPropertyBefore, int lineBreakPropertyAfter) {
        return PAIR_TABLE[lineBreakPropertyBefore - 1][lineBreakPropertyAfter - 1];
    }

